syntax = "proto3";

package iotserver;

option java_package = "com.klimalakamil.iot_server.core.protocol.tunnel";
option java_outer_classname = "TunnelProtocol";

message Tunnel {
    float message1 = 1;
    float message2 = 2;
    float message3 = 3;
    float message4 = 4;
    float message5 = 5;
    float message6 = 6;
    float message7 = 7;
    float message8 = 8;
}